const actions = {
  ADD_NEWS: 'ADD_NEWS',
  GET_LIST_NEWS_BEGIN: 'GET_LIST_NEWS_BEGIN',
  GET_NEWS_ITEM: 'GET_NEWS_ITEM',
  DELETE_NEWS_ITEM: 'DELETE_NEWS_ITEM',
  
  getListNewsBegin: () => ({
    type: actions.GET_LIST_NEWS_BEGIN,
  }),

  addNews: errorMessageAdd => {
    return {
      type: actions.ADD_NEWS,
      errorMessageAdd,
    };
  },
  getnewsItem: data => {
    return {
      type: actions.GET_NEWS_ITEM,
      data,
    };
  },
  deleteNewsItem: itemID => {
    return {
      type: actions.DELETE_NEWS_ITEM,
      itemID,
    };
  },
  searchNewsItems: dataSearch =>{
    return{
      type:actions.SEARCH
    }
  }
};
export default actions;
